            </div>
            <div className="flex flex-row flex-wrap gap-2 justify-center items-start">
                {chordNames.map((chordName, index) => (
                    <Chord 
                        key={`${index}-${chordName}`} 
                        name={chordName} 
                    />
                ))}
            </div>
        </div>
    );
};

